import React, { Fragment } from "react";
import styled, { css } from "styled-components";
import { Link } from "react-router-dom";
import Carousel from "react-multi-carousel";
import "react-multi-carousel/lib/styles.css";
import PhotographyCarousel from "./PhotographyCarousel";


export default function Visions() {
  const Container = styled.div`
    position: relative;
    overflow: hidden;
    width: 50%;
    height: 20vh;
    margin: auto;
  `;

  return (
    <Fragment>
      <h1 className="VisionTitle">Visions</h1>

      <Link to="./VisionsShow"  >
        <div className="visionsContainer">
          <div className="visionsDescriptions">
            <h2>Title</h2>
          </div>

          <PhotographyCarousel />
        </div>
      </Link>
      <Link to="./VisionsShow">
        <div className="visionsContainer">
          <div className="visionsDescriptions">
            <h2>Title</h2>
          </div>

          <PhotographyCarousel />
        </div>
      </Link>
      <Link to="./VisionsShow">
        <div className="visionsContainer">
          <div className="visionsDescriptions">
            <h2>Title</h2>
          </div>

          <PhotographyCarousel />
        </div>
      </Link>



     {/*  <div className="visionsContainer">
        <div className="visionsDescriptions">
          <h2>Title1</h2>
        </div>
        <PhotographyCarousel />
        <Link to="./VisionsShow"></Link>
      </div>
      <div className="visionsContainer">
        <div className="visionsDescriptions">
          <h2>Title3</h2>
        </div>
        <PhotographyCarousel />
        <Link to="./VisionsShow"></Link>
      </div> */}
    </Fragment>
  );
}
